svg.script:
(function() {
var circles = document.getElementsByTagName("circle");
var max = circles.length;
var i = 0;
var step = function() {
	if (i < max) {
		var circle = circles[i++];
		circle.setAttribute("fill", "yellow");
		circle.setAttribute("r", 2*circle.getAttribute("r"));
		setTimeout(step, 50);
	}
}
step();
})();
